import React, { useState } from "react";
import { Row, Col, Container } from "react-bootstrap";

import NavBar from "./NavBar";

const Dashboard = () => {
  return (
    <>
      <NavBar />
      <Container className="text-center dashboard" fluid>
        <Row>
          <Col>
            <h3
              style={{
                fontSize: "calc(22px + 2vw)",
                fontWeight: "bold",
                color: "#535353",
                textAlign: "left",
              }}
            >
              Your Dashboard
            </h3>
          </Col>
        </Row>
      </Container>
    </>
  );
};

export default Dashboard;
